// --- FUNGSI NORMALISASI TEKS ---
function normalizeText(text) {
  text = text.toLowerCase();
  return text;
}

// --- FUNGSI TOKENISASI ---
function tokenize(text) {
  return text.toLowerCase().match(/\w+/g) || [];
}

// --- FUNGSI LEVENSHTEIN DISTANCE ---
function levenshteinDistance(a, b) {
  const matrix = [];

  // Inisialisasi matriks
  for (let i = 0; i <= a.length; i++) {
    matrix[i] = [i];
  }
  for (let j = 0; j <= b.length; j++) {
    matrix[0][j] = j;
  }

  // Hitung jarak
  for (let i = 1; i <= a.length; i++) {
    for (let j = 1; j <= b.length; j++) {
      const cost = a[i - 1] === b[j - 1] ? 0 : 1;
      matrix[i][j] = Math.min(
        matrix[i - 1][j] + 1, // Deletion
        matrix[i][j - 1] + 1, // Insertion
        matrix[i - 1][j - 1] + cost // Substitution
      );
    }
  }

  return matrix[a.length][b.length];
}

// *** FUNGSI UTAMA UNTUK PENCARIAN ***
async function searchRegulations(keyword) {
  keyword = keyword.toLowerCase();
  const keywords = keyword.split(" ");

  const expandedKeywords = keywords.map((word) => {
    if (
      abbreviations.hasOwnProperty(word) ||
      abbreviations.hasOwnProperty(word.slice(0, -1))
    ) {
      const abbreviationKey = abbreviations.hasOwnProperty(word)
        ? word
        : word.slice(0, -1);
      return abbreviations[abbreviationKey];
    } else {
      return word;
    }
  });

  let searchTerms = [keywords.join(" ")];
  if (expandedKeywords.join(" ") !== keywords.join(" ")) {
    searchTerms.push(expandedKeywords.join(" "));
  }

  let results = [];

  // *** TAHAP 1: PENCARIAN DENGAN FUSE.JS ***
  await Promise.all(
    searchTerms.map(async (term) => {
      // *** FUSE OPTIONS UNTUK AKURASI ***
      const options = {
        includeScore: true,
        keys: ["title"],
        threshold: 0.4, // Nilai threshold untuk toleransi kesalahan
        useExtendedSearch: true,
        location: 0,
        distance: 150, // Nilai distance untuk toleransi typo
        ignoreLocation: true,
      };

      const fuse = new Fuse(regulations, options);
      const fuseComplete = new Fuse(regulationsCompleteData, options);

      const [fuseResults, fuseCompleteResults] = await Promise.all([
        fuse.search(term),
        fuseComplete.search(term),
      ]);

      results = results.concat(fuseResults, fuseCompleteResults);
    })
  );

  // *** TAHAP 2: PENILAIAN DENGAN LEVENSHTEIN DISTANCE ***
  results.forEach((result) => {
    const keywordTokens = tokenize(keyword);
    const titleTokens = tokenize(result.item.title);

    let totalDistance = 0;
    keywordTokens.forEach((keywordToken) => {
      let minDistance = Infinity;
      titleTokens.forEach((titleToken) => {
        const distance = levenshteinDistance(keywordToken, titleToken);
        minDistance = Math.min(minDistance, distance);
      });
      totalDistance += minDistance;
    });

    result.levenshteinDistance = totalDistance;
  });

  // Urutkan berdasarkan skor Fuse.js dan Levenshtein Distance
  results.sort((a, b) => {
    if (a.score === b.score) {
      return a.levenshteinDistance - b.levenshteinDistance; // Prioritaskan jarak edit yang lebih kecil
    }
    return a.score - b.score;
  });

  return results; // Kembalikan semua hasil yang diurutkan
}
